import React, { Component } from 'react'
import MediaPlayer from '../MediaPlayer/Media-Player'


class Results extends Component {
    constructor() {
        super();
        this.state = {
            interval: '',
            waiting4DB: true,
            buildingList: [],

        }
    }


    componentDidMount() {
        this.setState({ interval: setInterval(this.listen4DB, 1000) })
    }

    listen4DB = () => {
        if (this.props.response) {
            this.setState({ waiting4DB: false })
            this.stopListening4DB()
        }
    }

    stopListening4DB = () => {
        clearInterval(this.state.interval);
    }

    handleClick = (args) => {
        console.log(args)
    }

    render() {

        console.log(this.state.waiting4DB)

        let buildings = this.state.buildingList


        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[5].id.videoId}
                    />


                    {this.state.buildingList && 
                        <ul className="Suit_Results">
                            {buildings.map(building => <li key={Math.random() * Math.random()} onClick={() => this.handleClick()}>{building.number}</li>)}
                        </ul>}
                </div>}

            </div>
        )
    }

}

export default Results
